import { useEffect, useState } from "react";
import "./App.css";
import { watch } from "./Component/watch";

function App() {
  const date = new Date();
  const [time, setTime] = useState(date.toLocaleTimeString());

  useEffect(() => {
    setInterval(() => setTime(date.toLocaleTimeString()), 1000);
  }, [date]);

  return <h1>{time}</h1>;
}

export default App;
